import React from "react";
import Card from "./Card";
import deakin from "./1.png"
import "./Card.css";
import ListArray from "./ListArray";

const Cardlist = ()=>{
    return(<div className="box">
     <Card   
     /*technics ={faker.image.technics()}
     articalname = {faker.commerce.productName()   }
     des ={faker.commerce.productDescription()}
     name = {faker.name.fullName() }*/
     technics = {ListArray[0].technics}
     articalname={ListArray[0].arcticalname}
     des = {ListArray[0].des}
     name={ListArray[0].name}

     />
     <Card   
     /*technics ={faker.image.technics()}
     articalname = {faker.commerce.productName()   }
     des ={faker.commerce.productDescription()}
     name = {faker.name.fullName() }*/
     technics = {deakin}
     articalname="sdf"
     des = "sdf"
     name="sdf"

     />
     <Card   
     /*technics ={faker.image.technics()}
     articalname = {faker.commerce.productName()   }
     des ={faker.commerce.productDescription()}
     name = {faker.name.fullName() }*/
     technics = {deakin}
     articalname="sdf"
     des = "sdf"
     name="sdf"

     />
      

   
  



     </div>

    )

}

export default Cardlist
